import React, { useState, useEffect } from 'react';
import logo from './bd_logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header src="BreakDown" className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <p className="">
          Welcome to Breakdown!
        </p>
      </header>
    </div>
  );
}

export default App;
